import { moduleMetadata, Meta, StoryObj, StoryFn } from '@storybook/angular';
import { DxFormModule } from 'devextreme-angular';
import { MeFormDirective } from '../../public-api';

interface FormStoryArgs {
  size: 'small' | 'medium' | 'large';
  labelMode: 'outside' | 'static' | 'floating' | 'hidden';
  labelLocation: 'left' | 'top';
  colCount: 'auto' | 1 | 2 | 3;
  readOnly: boolean;
  showColonAfterLabel: boolean;
}

export default {
  title: 'Components/Form(RC)',
  component: MeFormDirective,
  decorators: [
    moduleMetadata({
      imports: [DxFormModule],
      declarations: [MeFormDirective],
    }),
  ],
  argTypes: {
    size: {
      control: 'select',
      options: ['small', 'medium', 'large'],
    },
    labelMode: {
      control: 'select',
      options: ['outside', 'floating', 'hidden'],
    },
    labelLocation: {
      control: 'radio',
      options: ['left', 'top'],
    },
    colCount: {
      control: 'select',
      options: ['auto', 1, 2, 3],
    },
    readOnly: {
      control: 'boolean',
    },
    showColonAfterLabel: {
      control: 'boolean',
    },
  },
} as Meta<FormStoryArgs>;

type Story = StoryObj<FormStoryArgs>;

const Template: StoryFn<FormStoryArgs> = (args) => ({
  props: {
    ...args,
    formData: {
      firstName: 'John',
      lastName: 'Doe',
      email: 'john.doe@example.com',
      phone: '+1 (555) 123-4567',
    },
  },
  template: `
    <dx-form
      meForm
      [size]="size"
      [formData]="formData"
      [labelMode]="labelMode"
      [labelLocation]="labelLocation"
      [colCount]="colCount"
      [readOnly]="readOnly"
      [showColonAfterLabel]="showColonAfterLabel"
    >
      <dxi-item dataField="firstName"></dxi-item>
      <dxi-item dataField="lastName"></dxi-item>
      <dxi-item dataField="email"></dxi-item>
      <dxi-item dataField="phone"></dxi-item>
    </dx-form>
  `,
});

export const Default: Story = {
  render: Template,
  args: {
    size: 'medium',
    labelMode: 'floating',
    labelLocation: 'top',
    colCount: 2,
    readOnly: false,
    showColonAfterLabel: true,
  },
};

export const SmallSize: Story = {
  render: Template,
  args: {
    ...Default.args,
    size: 'small',
  },
};

export const MediumSize: Story = {
  render: Template,
  args: {
    ...Default.args,
    size: 'medium',
  },
};

export const LargeSize: Story = {
  render: Template,
  args: {
    ...Default.args,
    size: 'large',
  },
};

export const FloatingLabels: Story = {
  render: Template,
  args: {
    ...Default.args,
    labelMode: 'floating',
  },
};

export const LeftLabels: Story = {
  render: Template,
  args: {
    ...Default.args,
    labelLocation: 'left',
  },
};

export const SingleColumn: Story = {
  render: Template,
  args: {
    ...Default.args,
    colCount: 1,
  },
};

export const ReadOnly: Story = {
  render: Template,
  args: {
    ...Default.args,
    readOnly: true,
  },
};

export const WithoutColon: Story = {
  render: Template,
  args: {
    ...Default.args,
    showColonAfterLabel: false,
  },
};

export const WithGrouping: Story = {
  render: Template,
  args: Default.args,
};

WithGrouping.decorators = [
  (Story) => ({
    template: `
      <dx-form
        meForm
        [size]="size"
        [formData]="formData"
        [labelMode]="labelMode"
        [labelLocation]="labelLocation"
        [colCount]="colCount"
        [readOnly]="readOnly"
        [showColonAfterLabel]="showColonAfterLabel"
      >
        <dxi-item itemType="group" caption="Personal Information">
          <dxi-item dataField="firstName"></dxi-item>
          <dxi-item dataField="lastName"></dxi-item>
          <dxi-item dataField="email"></dxi-item>
          <dxi-item dataField="phone"></dxi-item>
        </dxi-item>
        <dxi-item itemType="group" caption="Address Information">
          <dxi-item dataField="address"></dxi-item>
          <dxi-item dataField="city"></dxi-item>
          <dxi-item dataField="state"></dxi-item>
          <dxi-item dataField="zipCode"></dxi-item>
        </dxi-item>
      </dx-form>
    `,
  }),
];

import { Meta, StoryObj, moduleMetadata } from '@storybook/angular';
import { DxTabPanelModule } from 'devextreme-angular';
import { MeTabPanelDirective } from '../../public-api';

interface TabItem {
  id: number;
  title: string;
  content: string;
  icon?: string;
}

interface MeTabPanelProps {
  customClass: string;
  selectedIndex: number;
  animationEnabled: boolean;
  swipeEnabled: boolean;
  position: 'top' | 'bottom';
  size: 'small' | 'medium' | 'large';
  stylingMode: 'inside' | 'outside';
  orientation: 'horizontal' | 'vertical';
  iconPosition: 'top' | 'start' | 'end' | 'bottom';
  showNavButtons: boolean;
  scrollByContent: boolean;
  rtlEnabled: boolean;
  width: string | number;
  tabPanelData: TabItem[];
}

const meta: Meta<MeTabPanelProps> = {
  title: 'Components/TabPanel',
  component: MeTabPanelDirective,
  decorators: [
    moduleMetadata({
      declarations: [MeTabPanelDirective],
      imports: [DxTabPanelModule],
    }),
  ],
  render: (args: MeTabPanelProps) => ({
    props: args,
    template: `
      <dx-tab-panel
        meTabPanel
        [customClass]="customClass"
        [selectedIndex]="selectedIndex"
        [animationEnabled]="animationEnabled"
        [swipeEnabled]="swipeEnabled"
        [dataSource]="tabPanelData"
        [height]="300"
        [orientation]="orientation"
        [stylingMode]="stylingMode"
        [iconPosition]="iconPosition"
        [showNavButtons]="showNavButtons"
        [scrollByContent]="scrollByContent"
        [rtlEnabled]="rtlEnabled"
        [width]="width"
      >
      </dx-tab-panel>
    `,
  }),
  argTypes: {
    customClass: { control: 'text' },
    selectedIndex: { control: 'number' },
    animationEnabled: { control: 'boolean' },
    swipeEnabled: { control: 'boolean' },
    position: {
      options: ['top', 'bottom'],
      control: { type: 'select' },
    },
    size: {
      options: ['small', 'medium', 'large'],
      control: { type: 'select' },
    },
    stylingMode: {
      options: ['inside', 'outside'],
      control: { type: 'select' },
    },
    orientation: {
      options: ['horizontal', 'vertical'],
      control: { type: 'select' },
    },
    iconPosition: {
      options: ['top', 'start', 'end', 'bottom'],
      control: { type: 'select' },
    },
    showNavButtons: { control: 'boolean' },
    scrollByContent: { control: 'boolean' },
    rtlEnabled: { control: 'boolean' },
    width: { control: 'text' },
  },
};

export default meta;
type Story = StoryObj<MeTabPanelProps>;

const defaultTabPanelData: TabItem[] = [
  { id: 1, title: 'Tab 1', content: 'Content of Tab 1', icon: 'user' },
  { id: 2, title: 'Tab 2', content: 'Content of Tab 2', icon: 'email' },
  { id: 3, title: 'Tab 3', content: 'Content of Tab 3', icon: 'chart' },
];

export const Default: Story = {
  args: {
    customClass: '',
    selectedIndex: 0,
    animationEnabled: true,
    swipeEnabled: true,
    position: 'top',
    size: 'medium',
    stylingMode: 'inside',
    orientation: 'horizontal',
    iconPosition: 'start',
    showNavButtons: false,
    scrollByContent: false,
    rtlEnabled: false,
    width: 'auto',
    tabPanelData: defaultTabPanelData,
  },
};

export const VerticalOrientation: Story = {
  args: {
    ...Default.args,
    orientation: 'vertical',
  },
};

export const WithNavButtons: Story = {
  args: {
    ...Default.args,
    showNavButtons: true,
    width: '300px',
    tabPanelData: [
      ...defaultTabPanelData,
      { id: 4, title: 'Tab 4', content: 'Content of Tab 4', icon: 'home' },
      { id: 5, title: 'Tab 5', content: 'Content of Tab 5', icon: 'event' },
    ],
  },
};

export const OutsideStylingMode: Story = {
  args: {
    ...Default.args,
    stylingMode: 'outside',
  },
};

export const DifferentIconPositions: Story = {
  args: {
    ...Default.args,
    iconPosition: 'top',
  },
};

export const RightToLeft: Story = {
  args: {
    ...Default.args,
    rtlEnabled: true,
  },
};

